import React from 'react';
import Navbare from './Navbare';
import Contact from './Contact';

const Accueil = () => {
  
    return (
        <div>
            <div style={{ marginTop: '100px' }}></div>
            <Navbare/>
            <h3>SALAMA DAHOLO EH</h3>
            <Contact message="Bonjour"/>
        </div>
    );
};

export default Accueil;
